{'id': 2401, 'aggregated_rating': 70.0, 'aggregated_rating_count': 2, 'category': 0, 'first_release_date': 861321600, 'involved_companies': [5589, 5590], 'name': 'Jonah Lomu Rugby', 'platforms': [7, 13, 32], 'summary': 'Jonah Lomu Rugby is a sports video game developed by Rage Software and published by Codemasters in 1997. It was released for MS-DOS, PlayStation and Sega Saturn. It was the first rugby union game released on the Saturn or PlayStation platforms.

It has five game modes: Friendly, World Cup, Tournament, Territories Cup and Classic Matches.

The title of the video game refers to former New Zealand winger Jonah Lomu.', 'updated_at': 1727332861}
